import React from "react";

class MenuListItem extends React.Component {
  navClick = () => {
    console.log(this.props.text);
  };

  render() {
    return (
      <li className="nav-link" onClick={this.navClick}>
        {this.props.text}
      </li>
    );
  }
}

export default MenuListItem;
